        function generateRandomCategory() {
            const cats = Object.values(JSON.parse(catsStr));

            // Define the filtering criteria
            const filterCriteria = { isIL: false, isSeeded: false, isCoOp: false };

            // Filter the list based on the criteria
            const filteredCats = cats.filter(item => {
                for (const key in filterCriteria) {
                    if (item[key] !== filterCriteria[key]) {
                        return false;
                    }
                }
                return true;
            });

            //Pick random cat from filtered list
            const randomIndex = Math.floor(Math.random() * filteredCats.length);
            const randomCat = filteredCats[randomIndex];

            // Update category text
            const category = document.getElementById('randomCategory');
            category.textContent = randomCat.name;
            category.href = "https://mossranking.com/cat.php?cat=" + randomCat.id;
        }
